// src/components/Footer.jsx
import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <footer className="mdp-footer" role="contentinfo" aria-label="Site footer">
      <div className="mdp-footer__line" aria-hidden="true" />
      <div className="mdp-footer__inner">
        <p className="mdp-footer__brand" title="Toyota MicroDoppler Project">
          Toyota MicroDoppler Project Â© 2025
        </p>
      </div>
    </footer>
  );
};

export default Footer;
